import React from "react";
import { FaHome } from "react-icons/fa";
import heroImage from "../assets/hero.jpg";

function Home() {
  return (
    <div className="p-12">
      <h2 className="text-3xl font-bold mb-10 text-blue-400 flex items-center gap-2">
        <FaHome /> Welcome to Blueprints of Growth
      </h2>

      <img
        src={heroImage}
        alt="Hero"
        className="rounded-2xl shadow-lg mb-8 w-full max-h-[500px] object-cover"
      />

      <section className="mb-12">
        <h3 className="text-2xl font-bold text-blue-300 mb-4">About Me</h3>
        <p className="text-lg leading-relaxed">
          My name is Mahek Bhagchandani, and I’m currently pursuing my Master’s in Industrial and Organizational Psychology at the University of New Haven. Since 2019, my journey has been fueled by a desire to create meaningful impact through community, leadership, and human-centered strategy. I’m a South Asian woman navigating spaces that haven’t always been built for me — which is exactly why I work to change that. From starting a cultural dance club that won campus-wide awards to co-creating a digital platform for workplace well-being, I’ve always sought to bridge performance with purpose. My roles span student leadership, HR development, event design, and cultural storytelling. I believe that vulnerability and inclusion are core to effective leadership, and that systems should empower, not restrict. My personal experiences, both challenging and triumphant, have shaped a vision of work where people feel seen, valued, and connected. Whether it’s coaching a team, designing surveys, or planning events, my goal is to leave every space better than I found it. This site is a reflection of that commitment.
        </p>
      </section>
    </div>
  );
}

export default Home;
